import { Link } from "react-router-dom"
export default function Navbar() {
    return (
    <nav>
        <ul>
            <li><strong>Koreigners</strong></li>
        </ul>
        <ul>
            <li><a href="#">About</a></li>
            <li> <Link to="/login" role="button">Login</Link></li>
        </ul>
    </nav>
    );
}
